// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Candidat {

    struct _Candidat {
        address adresa;
        string nume;
        uint256 numarVoturi;
    }

    mapping(address => _Candidat) candidati;
    mapping(string => address) adreseCandidati;

    address ownerAddress;
    uint256 taxaParticipare;
    address[] adrese;

    constructor(address _ownerAddress, uint256 _taxaParticipare) {
        ownerAddress = _ownerAddress;
        taxaParticipare = _taxaParticipare;
    }

    function incrementeazaVoturi(string memory _nume) public {
        candidati[adreseCandidati[_nume]].numarVoturi++;
    }

    function getOwner() public view returns (address) {
        return ownerAddress;
    }

    function inscrieCandidat(string memory _nume) public payable {
        require(adreseCandidati[_nume] == address(0), "Exista un candidat cu acest nume!");
        require(candidati[msg.sender].adresa == address(0), "Sunteti deja inscris ca si candidat!");
        require(msg.value >= taxaParticipare, "Fonduri insuficiente!");

        candidati[msg.sender] = _Candidat({
            adresa: msg.sender,
            nume: _nume,
            numarVoturi: 0
        });
        adreseCandidati[_nume] = msg.sender;
        adrese.push(msg.sender);

        payable(ownerAddress).transfer(taxaParticipare);
    }

    function getNumarVoturi(string memory _numeCandidat) public view returns (uint256) {
        return candidati[adreseCandidati[_numeCandidat]].numarVoturi;
    }

    function calculeazaCastigator() external view returns (string memory){
        uint256 n = adrese.length;
        uint256 maxi = 0;
        string memory castigator = "";

        for(uint256 i=0;i < n;i++){
            if(maxi < candidati[adrese[i]].numarVoturi){
                maxi = candidati[adrese[i]].numarVoturi;
                castigator = candidati[adrese[i]].nume;
            }
        }

        return castigator;
    }

}

contracts/JetonERC20.sol.content:
// SPDX-License-Identifier: MIT 
pragma solidity >=0.7.0 <0.9.0;

import "hardhat/console.sol";

contract JetonERC20{

    uint256 nbTokens;   

    mapping(address => uint256) balances;
    mapping(address => mapping (address => uint256)) spendlimit;

    string public name ="Token optional BC";               
    uint8 public decimals = 0;                
    string public symbol = 'EuroVision';  

    uint256 public expirationTimestamp;

    event Approval(address indexed tokenOwner, address indexed spender, uint tokens);
    event Transfer(address indexed from, address indexed to, uint tokens);


    modifier checkBalance (address owner, uint tokens) {
        console.log(owner);
        require(tokens <= balances[owner], 'Insufficient funds!');
        _;
    }

    modifier checkApproval (address owner, address delegate, uint tokens) {
        require(tokens <= spendlimit[owner][delegate], 'Insufficient allowance!');
        _;
    }

    modifier checkValidity () {
        require(block.timestamp <= expirationTimestamp, 'Token has expired!');
        _;
    }

    constructor(uint256 tokens) {
        nbTokens = tokens;
        balances[msg.sender] = tokens;
        expirationTimestamp = block.timestamp + 3 * 23 * 60 * 60;
    }

    function totalSupply() public view returns (uint256) { 
        return nbTokens;
    }

    function balanceOf(address tokenOwner) public view returns (uint) { 
        return balances[tokenOwner]; 
    }

    function transfer(address receiver, uint tokens) public checkBalance(tx.origin ,tokens) checkValidity
								returns (bool) {   
        balances[tx.origin] = balances[tx.origin] - tokens;
        balances[receiver] = balances[receiver] + tokens;
        emit Transfer(tx.origin, receiver, tokens);
        return true;    
    }

    function approve(address spender, uint tokens) public checkValidity returns (bool) {
        spendlimit[msg.sender][spender] = tokens;
        emit Approval(msg.sender, spender, tokens);
        return true;
    }

    function allowance(address tokenOwner, address spender) public view 
								returns(uint) {
        return spendlimit[tokenOwner][spender];
    }

    function transferFrom(address from, address to, uint tokens) 
            public  checkBalance (from, tokens) 
                    checkApproval(from, msg.sender, tokens) 
                    checkValidity returns (bool) {

        balances[from] = balances[from] - tokens;
        spendlimit[from][msg.sender] = spendlimit[from][msg.sender]- tokens;
        balances[to] = balances[to] + tokens;
        emit Transfer(from, to, tokens);
        return true;
    }
}

